import React, { Component } from "react";

export default class Node extends Component {
    constructor() {
        super();
        this.state = {
            parent: {},
            left: {},
            right: {},
            height: {},
            start: props.start,
            end: props.end
        };
    }
    render() {
        const nodeStyle = {
            height: "50px",
            width: "50px",
            gridColumnStart: this.state.start,
            gridColumnEnd: this.state.end,
        
            backgroundColor: "#fff",
            borderRadius: "50%",
            border: "2px solid red",
        
            display: "flex",
            justifyContent: "center",
            alignItems: "center"
        }

        return (
            <div style={nodeStyle}>
                {this.props.value}
            </div>
        );
    }
}
